let signIn = (email, password) => {
  const requestOptions = {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({ email, password }),
  };

  return fetch("/signin", requestOptions)
    .then(handleResponse)
    .then((user) => {
      return user;
    });
};

